import { Layout, theme } from "antd";
import './Homepage.css'
const {Header,Content} =Layout

function HomePage(){
    const {
        token: { colorBgContainer },
      } = theme.useToken();
    return(
        <div>
        <Header
            style={{
                textAlign: 'left',
                color:'black',
                background:'#f5f5f5',
            }}>
                <header className="home">Home</header>
            </Header>

        
        <Layout>
            <Content>
                <div style={{
                    margin:'10px 16px 0',


                }}>

                </div>
            </Content>
        </Layout>
        </div>
        
    )
}
export default HomePage;
